import React from "react";
import "./LogoutBar.css";

const LogoutBar = (props) => {
  const logout = () => {
    props.logoutit();
  };
  return (
    <nav>
      <button onClick={logout}>Logout</button>
    </nav>
  );
};

export default LogoutBar;
